manufacturedarray.each do |all|
  all.each do |m|
    name = m[:name]
    if !Modality.find_by_name(name)
      @modality = Modality.create!(name: name)
    else @modality = Modality.find_by_name(name)
    end
    if @modality.name == "Bone Densitometer"
      @modtype = @modality.modtypes.create(:name => name)
      m[:categories].each do |manuf|
        name = manuf[:name]
        if !Manufacturer.find_by_name(manuf[:name])
          @manufacturer = Manufacturer.create!(name: name)
          @modtype.modtypemanufacturers.create(:manufacturer_id => @manufacturer.id)
          puts "Getting #{@modality.name} with #{@modtype.name} with #{@manufacturer.name} found"
        else
          @manufacturer = Manufacturer.find_by_name(manuf[:name])
          @modtype.modtypemanufacturers.create(:manufacturer_id => @manufacturer.id)
          puts "Building #{@modality.name} with #{@modtype.name} with #{@manufacturer.name}"
        end
      end          
    else
      m[:categories].each do |sub|
        name = sub[:name]
        @modtype = @modality.modtypes.create(:name => name)
        sub[:categories].each do |manuf|
          name = manuf[:name]
          if !Manufacturer.find_by_name(manuf[:name])
            @manufacturer = Manufacturer.create!(name: name)
            @modtype.modtypemanufacturers.create(:manufacturer_id => @manufacturer.id)
            puts "Getting #{@modality.name} with #{@modtype.name} with #{@manufacturer.name} found"
          else
            @manufacturer = Manufacturer.find_by_name(manuf[:name])
            @modtype.modtypemanufacturers.create(:manufacturer_id => @manufacturer.id)
            puts "Building #{@modality.name} with #{@modtype.name} with #{@manufacturer.name}"
          end
        end
      end
    end
  end
end
